export default function Login() {
  return (
    <>
      <div className="container px-5 py-24 mx-auto flex justify-center gap-2 items-center">
        <h1 className="text-3xl font-bold underline">Signin</h1>
        <input type="number" className="border-solid border-gray-500 rounded" />
        <input type="password" className="border-solid border-gray-500 rounded" />
      </div>
    </>
  );
}
